import { useState } from "react";
import { Bar } from "react-chartjs-2";
import { Chart as ChartJS } from "chart.js/auto";
import "./Chart.css";
export const Chart = () => {
  const dummyData = [
    { id: 1, name: "18-28", value: 200 },
    { id: 2, name: "28-38", value: 180 },
    { id: 3, name: "28-38", value: 401 },
    { id: 4, name: "48-58", value: 80 },
    { id: 5, name: "58-68", value: 50 },
    { id: 6, name: "68-78", value: 30 },
    { id: 7, name: " 78+", value: 10 },
  ];

  const [users, setUsers] = useState({
    labels: dummyData.map((user) => user.name),
    datasets: [
      {
        data: dummyData.map((user) => user.value),
        backgroundColor: ["#3D44DB"],
      },
    ],
  });
  return (
    <div className="chartContainer">
      <h3 className="chartTitle">Godine korisnika</h3>
      <Bar data={users} />
    </div>
  );
};
